import React from 'react';
import logo from './logo.svg';
import './App.css';

const Reset = () => {
  return (
    <a href="" onClick={console.log('reset')} id="resetBtn"></a>
  );
}

const Header = (props) => {
  return (
      <header>
          <h1>{props.title}</h1>
          <h2>{props.subtitle}</h2>



          <div className="supporting">

          </div>
      </header>
  );
}

const App = () => {
  return (
    <div className='scoreboard'>
        <Header title="Call Routing" subtitle="Text" />

        <div id="nn">
        {prop.initPlayers.map(e => 
            <Player key={e.id.toString()} name={e.name} />    
        )}
        </div>

        <div id="traditional">
        {prop.initPlayers.map(e => 
            <Player key={e.id.toString()} name={e.name} />    
        )}
        </div>

    </div>
  );
}

export default App;
